import React from "react";
const Catalogo = () => {
  return (
    <>
      <main className="principal">
        <h2>Catalogos de livros</h2>
        <ul>
            <li>
                <a href="#">Livro 1</a>
            </li>
            <li>
                <a href="#">Livro 2</a>
            </li>
        </ul>
      </main>
    </>
  );
};
export default Catalogo;
